{Today : '2024-09-13 10:00:00', conversations : 내일 아침에 교회에 가서 예배 드려야 해. 
 꼭 시간 맞춰서 가도록 해. 
 예배 후에는 성경 공부도 있어.}

{Today : '2024-09-13 11:30:00', conversations : 이번 주 토요일에 성당에서 미사가 드려야 합니다. 
 가족도 함께 참석할 거예요. 
 미사 후에 소풍도 계획 중이에요.}

{Today : '2024-09-13 12:45:00', conversations : 다음 주 화요일 저녁에 불교 사찰에 참배할 예정이야. 
 명상 시간도 함께 할 거고. 
 가족과 함께 가면 좋겠어.}

{Today : '2024-09-13 14:20:00', conversations : 다다음주 금요일에 교회 대형 예배가 있어요. 
 모든 신도들이 참석해야 합니다. 
 예배 후에 친교 시간도 있습니다.}

{Today : '2024-09-13 15:30:00', conversations : 글피에 절에서 연등회를 할 거야. 
 가족들과 함께 참여해보자. 
 조용한 시간 보내고 싶어.}

{Today : '2024-09-13 16:45:00', conversations : 다음주 목요일에 회당에서 불교 세미나가 열려요. 
 관심 있는 분들은 참여해 주세요. 
 세미나 후에 다과회도 준비되어 있습니다.}

{Today : '2024-09-13 17:50:00', conversations : 내일 새벽에 사찰에서 참배 모임이 있어요. 
 일찍 일어나서 함께 가야겠어요. 
 날씨도 좋을 테니 기대됩니다.}

{Today : '2024-09-13 18:30:00', conversations : 10월 5일에 교회에서 부흥회가 개최됩니다. 
 많은 분들이 참석할 예정이에요. 
 준비를 철저히 해야 해요.}

{Today : '2024-09-13 19:15:00', conversations : 다음 주 금요일에 사당에서 기도회가 있어요. 
 꼭 참석해주세요. 
 기도회 후에 명상 시간도 가질 예정입니다.}

{Today : '2024-09-13 20:45:00', conversations : 다가오는 9월 30일에 사찰에서 대보름 행사 있어요. 
 등불을 띄우고 함께 축하해요. 
 가족과 함께 가면 좋겠어요.}

{Today : '2024-09-13 21:00:00', conversations : 내년 1월 7일에 교회에서 성탄 예배가 있을 거야. 
 온 가족이 모여서 함께 예배 드리자. 
 예배 후에 식사도 함께 할 예정이야.}

{Today : '2024-09-13 22:10:00', conversations : 그제에 교회에서 부흥제가 있었었죠? 
 이번에는 좀 더 큰 행사를 준비해야 해요. 
 다음주에 다시 만나서 계획을 세우죠.}

{Today : '2024-09-13 08:00:00', conversations : 내일 모레 사당에서 주일학교가 열려요. 
 아이들이 참여할 수 있게 도와주세요. 
 주일학교 후에는 부모님 회의도 예정입니다.}

{Today : '2024-09-13 09:30:00', conversations : 이번 주 일요일에 교회에서 특별 예배가 있어요. 
 많은 분들이 참석할 예정입니다. 
 예배 후에는 찬양대 연습도 있습니다.}

{Today : '2024-09-13 10:15:00', conversations : 10월 10일에 교회에서 금요기도회가 있습니다. 
 모두 참석해 주세요. 
 기도회 후에 친교 시간도 가질 거예요.}

{Today : '2024-09-13 11:00:00', conversations : 모레 새벽에 사찰에서 조용한 명상회를 가질 거예요. 
 참여하실 분들은 준비해주세요. 
 명상 후에 간단한 다과도 제공됩니다.}

{Today : '2024-09-13 12:30:00', conversations : 다음주 월요일에 교회에서 성경 공부가 있습니다. 
 꼭 참석해 주세요. 
 성경 공부 후에는 토론 시간이 있습니다.}

{Today : '2024-09-13 13:45:00', conversations : 내일 3시에 교회에서 봉사활동이 있어요. 
 참여할 수 있도록 준비해 주세요. 
 봉사활동 후에는 간단한 다과가 제공됩니다.}

{Today : '2024-09-13 14:50:00', conversations : 다음 주 금요일에 교회에서 신년 예배가 있어요. 
 모든 신도들이 참석해야 합니다. 
 예배 후에는 신년 소원 작성 시간이 있습니다.}

{Today : '2024-09-13 16:00:00', conversations : 다다음주 토요일에 교회에서 찬양대 공연이 있습니다. 
 모두 참여해 주세요. 
 공연 후에는 다과회도 열립니다.}

{Today : '2024-09-25 10:00:00', conversations : 이번 주일에 교회에서 성가대 연습이 있다고 들었지? 
 꼭 참석해서 준비하자꾸나. 
 그리고 다음 주 수요일에는 성서 공부 모임도 있단다.}

{Today : '2024-09-25 09:15:00', conversations : 나흘 뒤에 절에서 다도회가 열리니 참석할 거지? 
 그럼 미리 준비해두자. 
 그리고 다음주 금요일에는 명상 수업도 있단다.}

{Today : '2024-09-25 13:50:00', conversations : 내일 모레 절에서 열리는 법회에 참석할래? 
 가족들도 함께 오면 좋을 것 같아. 
 그리고 다음 주 일요일에는 교회 피로연도 있단다.}

{Today : '2024-09-25 12:10:00', conversations : 그제에 다녀온 교회 연회가 아직도 기억에 남아. 
 이번 주 금요일에도 비슷한 모임이 있을 거야. 
 그리고 내일은 절에서 기도하는 날이니 꼭 참석하자.}

{Today : '2024-09-25 20:30:00', conversations : 어제 다녀온 성당의 축제가 정말 좋았지? 
 이번 주 토요일에도 다시 한 번 가보자. 
 그리고 다음달에는 특별 기도회도 있으니 준비해야 해.}

{Today : '2024-09-25 06:50:00', conversations : 다음주 일요일에 교회에서 새벽 기도가 있으니 일찍 일어나야 해. 
 그리고 그날 저녁에는 성경 공부도 예정되어 있단다. 
 꼭 참석해주길 바라.}

{Today : '2024-09-25 22:15:00', conversations : 다다음주 금요일에 교회에서 열리는 연례 집회에 대해 준비해야 해. 
 그때 모두 함께 모여야 한다. 
 또한, 내년 2월에는 특별 예배도 있을 예정이야.}

{Today : '2024-09-25 13:00:00', conversations : 그글피에 교회에서 열리는 야외 예배에 대해 알고 있니? 
 그때 가족들과 함께 가보자. 
 또한, 다음 달에는 절에서 참배 행사도 있으니 잊지 말고.}

{Today : '2024-09-25 18:25:00', conversations : 내일 새벽에 교회에서 특별 기도회가 있어. 
 그리고 모레에는 절에서 조계종 모임도 있으니 같이 가자. 
 가족들에게도 알려줘.}

{Today : '2024-09-25 21:10:00', conversations : 어제 다녀온 교회 행사는 정말 뜻깊었지? 
 이번 주 목요일에도 비슷한 모임이 있으니 꼭 참석해야 해. 
 그리고 다음주 토요일에는 절에서 열리는 연등회도 기대하고 있어.}

{Today : '2024-09-25 23:50:00', conversations : 다음주 금요일에 교회에서 열리는 성찬식에 대해 생각해봤니? 
 그날은 가족들과 함께 참석하면 좋을 것 같아. 
 그리고 그끄제에는 절에서 열린 명상회도 준비해야 해.}

{Today : '2024-09-25 19:45:00', conversations : 그제에 다녀온 교회 예배가 아직도 생생하니? 
 이번 주 일요일에도 다시 참석해보자. 
 또한, 다음달에는 절에서 열리는 축제도 기대해도 좋아.}

{Today : '2024-09-25 07:00:00', conversations : 다음주 수요일에 교회에서 열리는 청년 모임에 대해 알고 있니? 
 그때 가족들과 함께 가보자. 
 그리고 모레에는 절에서 열리는 불교 명상회도 준비해야 해.}

{Today : '2024-09-25 15:30:00', conversations : 내년 1월 7일에 교회에서 열리는 특별 예배를 준비해야 해. 
 그날은 가족 모두가 참석해야 한다. 
 그리고 이번 주 금요일에는 절에서 열린 기도회도 있어.}

{Today : '2024-09-25 12:00:00', conversations : 이번 내년에 교회에서 열리는 대규모 집회에 대해 미리 준비해야 해. 
 그리고 그끄제 절에서 열리는 참배 행사도 잊지 말아야 해. 
 가족들과 함께 계획을 세우자.}

{Today : '2024-09-25 10:30:00', conversations : 다음 주 월요일에 교회에서 열리는 성가대 연습을 기억하지? 
 그때 꼭 참석해서 준비해야 해. 
 또한, 내일은 절에서 열리는 기도회도 있으니 함께 가자.}
